to the Land of Oz. There, he encounters a kind (but naive) witch, Theodora. She
believes him to be a wizard prophesied to destroy the Wicked Witch who killed the
King of Oz and take his place; the idea of being an immensely wealthy monarch makes
him immediately accept. En route to the Emerald City, Theodora falls in love with Oscar
though he does not truly reciprocate her feelings. They encounter the flying monkey
Finley, who pledges a life debt to Oscar when he saves him from a lion. Oscar reveals
his deception to Finley along the way, forcing him to help maintain the lie that he
